import React, { useState } from 'react';

function AddPlant() {
  const [formData, setFormData] = useState({
    name: '',
    scientific_name: '',
    adopted_tech: '',
    avg_yield: '',
    edible_part: '',
    family: '',
    nutrition: '',
    pests: '',
    planting_material: '',
    pollination: '',
    source: '',
    variety: '',
    vernacular_name: '',
    flowering: '',
    fruiting: '',
    duration: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch('http://localhost:8081/addplant', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(formData)
    })
    .then(response => response.json())
    .then(data => {
      console.log('Success:', data);
      // Handle success
    })
    .catch((error) => {
      console.error('Error:', error);
      // Handle error
    });
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} />
      <input type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      <input type="text" name="adopted_tech" placeholder="Adopted Technology" value={formData.adopted_tech} onChange={handleChange} />
      <input type="text" name="avg_yield" placeholder="Average Yield" value={formData.avg_yield} onChange={handleChange} />
      <input type="text" name="edible_part" placeholder="Edible Part" value={formData.edible_part} onChange={handleChange} />
      <input type="text" name="family" placeholder="Family" value={formData.family} onChange={handleChange} />
      <input type="text" name="nutrition" placeholder="Nutrition" value={formData.nutrition} onChange={handleChange} />
      <input type="text" name="pests" placeholder="Pests" value={formData.pests} onChange={handleChange} />
      <input type="text" name="planting_material" placeholder="Planting Material" value={formData.planting_material} onChange={handleChange} />
      <input type="text" name="pollination" placeholder="Pollination" value={formData.pollination} onChange={handleChange} />
      <input type="text" name="source" placeholder="Source" value={formData.source} onChange={handleChange} />
      <input type="text" name="variety" placeholder="Variety" value={formData.variety} onChange={handleChange} />
      <input type="text" name="vernacular_name" placeholder="Vernacular Name" value={formData.vernacular_name} onChange={handleChange} />
      <input type="text" name="flowering" placeholder="Flowering" value={formData.flowering} onChange={handleChange} />
      <input type="text" name="fruiting" placeholder="Fruiting" value={formData.fruiting} onChange={handleChange} />
      <input type="text" name="duration" placeholder="Duration" value={formData.duration} onChange={handleChange} />
      <button type="submit">Add Plant</button>
    </form>
  );
}

export default AddPlant;
